  \"2016-04-19T02:29:27.618889\",\n\t\"name\": \"draft-imagine-austin-indicators\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Imagine Austin comprehensive plan calls
  for an analysis and assessment of indicators or metrics that can be used to measure
  progress after the plan's fifth year.  Many of the indicators were suggested and
  not completely scoped, and some were aspirational, or not measurable at the time.
  \ The indicators presented here are those that staff proposes for intense analysis
  after year five.  The associated data was the most current at the time collected,
  and serves as a baseline to compare to future numbers.  The \"Additional Indicators\"
  available at https://data.austintexas.gov/Government/Draft-Additional-Imagine-Austin-Indicators/7dis-buys
  includes many of the other indicators in the plan.  These are primarily tracked
  by other entities, or not deemed as highly relevant and therefore may not receive
  the same level of analysis.  Indicators may be revised as new techniques or data
  become available.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
